hat vuforia is initialized in findBeaconColorState public static State findBeaconColorState(StateName stateName, final StateName successState, final StateName failState, final StateName timeoutState, Time timeoutTime, final ResultReceiver<VuforiaFrameFeeder> vuforiaReceiver, final ResultReceiver<BeaconColorResult> beaconColorResult, TeamColor teamColor, final int numFrames, final boolean saveImages) { final List<BeaconName> beaconNames = BeaconName.getNamesForTeamColor(teamColor); final EndCondition timeout = EndConditions.timed(timeoutTime); return new BasicAbstractState(stateName) { private VuforiaFrameFeeder vuforia = null; private VuforiaBeaconColorProcessor processor = null; private BeaconName beaconName; private int beaconIndex = 0; //index of the beaconNames list private boolean timedOut = false; @Override public void init() { timeout.init(); timedOut = false; if (beaconIndex >= beaconNames.size()) { beaconIndex = 0; //we should never go here } beaconName = beaconNames.get(beaconIndex); if (processor != null) { processor.setBeaconName(beaconName); } } @Override public boolean isDone() { if (vuforia == null && vuforiaReceiver.isReady()) { vuforia = vuforiaReceiver.getValue();
// if (vuforia == null) {
// Log.e("EVStates", "vuforia is null!!!!!!!!!!!!!");
// } processor = new VuforiaBeaconColorProcessor(vuforia); processor.setBeaconName(beaconName); VuforiaTrackable beacon = beacons.get(beaconName); beacon.getTrackables().activate(); frameGrabber.setImageProcessor(processor); frameGrabber.setSaveImages(saveImages); frameGrabber.grabContinuousFrames(); } timedOut = timeout.isDone(); return timedOut || processor != null && processor.getResultsFound() >= numFrames; } @Override public StateName getNextStateName() { beaconIndex++; frameGrabber.stopFrameGrabber(); VuforiaTrackable beacon = beacons.get(beaconName); beacon.getTrackables().deactivate(); BeaconColorResult result = processor.getAverageResult(); processor.reset(); BeaconColorResult.BeaconColor leftColor = result.getLeftColor(); BeaconColorResult.BeaconColor rightColor = result.getRightColor(); if ((leftColor == BeaconColorResult.BeaconColor.RED && rightColor == BeaconColorResult.BeaconColor.BLUE) || (leftColor == BeaconColorResult.BeaconColor.BLUE && rightColor == BeaconColorResult.BeaconColor.RED)) { beaconColorResult.setValue(result); return successState; } else { beaconColorResult.setValue(new BeaconColorResult()); if (timedOut) { return timeoutState; } else { return failState; } } } }; } public static State findColorState(StateName stateName, final StateName successState, final StateName unknownState, final ResultReceiver<VuforiaFrameFeeder> vuforiaReceiver, final ResultReceiver<BeaconColorResult.BeaconColor> colorResult, final boolean saveImages) { return new BasicAbstractState(stateName) { private VuforiaFrameFeeder vuforia = null; private CloseUpColorProcessor processor = null; private boolean timedOut = false; @Override public void init() { vuforia = vuforiaReceiver.getValue(); processor = new CloseUpColorProcessor(); frameGrabber.setImageProcessor(processor); frameGrabber.setSaveImages(saveImages); frameGrabber.grabSingleFrame(); } @Override public boolean isDone() { return frameGrabber.isResultReady(); } @Override public StateName getNextStateName() { BeaconColorResult.BeaconColor result = (BeaconColorResult.BeaconColor) frameGrabber.getResult().getResult(); colorResult.setValue(result); if (result == BeaconColorResult.BeaconColor.RED || result == BeaconColorResult.BeaconColor.BLUE) { return successState; } else { return unknownState; } } }; } public static State beaconColorSwitch(StateName stateName, final StateName redState, final StateName blueState, final StateName unknownState, ResultReceiver<BeaconColorResult.BeaconColor> colorResult) { return new BasicAbstractState(stateName) { @Override public void init() { } @Override public boolean isDone() { return true; } @Override public StateName getNextStateName() { BeaconColorResult.BeaconColor result = (BeaconColorResult.BeaconColor) frameGrabber.getResult().getResult(); switch (result) { case RED: return redState; case BLUE: return blueState; default: return unknownState; } } }; } /** * use the camera to detect and drive up to the beacon * * @param stateName the name of the state * @param doneState the state to go to if it works * @param lostObjectState the state to go to if it cannot find the beacon * @param timeoutState the state to go to if it times out * @param timeoutMillis the number of milliseconds before the timeout * @param mecanumControl the mecanum wheels * @param frameGrabber access to the camera frames * @return the created State */ public static State mecanumCameraTrack(StateName stateName, final StateName doneState, final StateName lostObjectState, final StateName timeoutState, long timeoutMillis, final MecanumControl mecanumControl, final FrameGrabber frameGrabber, ImageProcessor<? extends Location> imageProcessor) { mecanumControl.setDriveMode(MecanumMotors.MecanumDriveMode.NORMALIZED); final TranslationControl beaconTrackingControl = TranslationControls.cameraTracking(frameGrabber, imageProcessor); final long timeoutTime = System.currentTimeMillis() + timeoutMillis; return new BasicAbstractState(stateName) { @Override public void init() { mecanumControl.setTranslationControl(beaconTrackingControl); } @Override public boolean isDone() { return !mecanumControl.translationWorked() || beaconTrackingControl.getTranslation().getLength() < 0.1 || System.currentTimeMillis() >= timeoutTime; } @Override public StateName getNextStateName() { mecanumControl.stop(); if (beaconTrackingControl.getTranslation().getLength() < 0.1) { return doneState; } else { if (!mecanumControl.translationWorked()) { return lostObjectState; } else { return timeoutState; } } } }; } /** * @param stateName the name of the state * @param nextStateName the name of the next state * @param imageProcessor the object that processes the image * @param resultReceiver the object that stores the image * @return the created State */ public static State processFrame(StateName stateName, final StateName nextStateName, final ImageProcessor imageProcessor, final ResultReceiver<ImageProcessorResult> resultReceiver) { return new BasicAbstractState(stateName) { @Override public void init() { frameGrabber.setImageProcessor(imageProcessor); frameGrabber.grabSingleFrame(); } @Override public boolean isDone() { return frameGrabber.isResultReady(); } @Override public StateName getNextStateName() { resultReceiver.setValue(frameGrabber.getResult()); return nextStateName; } }; } /** * @param stateName the name of the state * @param unknownUnknownState if both sides are unknown * @param unknownRedState if the left is unknown and the right is red * @param unknownBlueState if the left is unknown and the right is blue * @param redUnknownState if the left is red and the right is unknown * @param redRedState if the left is red and the right is red * @param redBlueState if the left is red and the right is blue * @param blueUnknownState if the left is blue and the right is unknown * @param blueRedState if the left is blue and the right is red * @param blueBlueState if the left is blue and the right is blue * @return the created State */ public static State processBeaconPicture(StateName stateName, final StateName unknownUnknownState, final StateName unknownRedState, final StateName unknownBlueState, final StateName redUnknownState, final StateName redRedState, final StateName redBlueState, final StateName blueUnknownState, final StateName blueRedState, final StateName blueBlueState ) { return new BasicAbstractState(stateName) { @Override public void init() { frameGrabber.setImageProcessor(new RGBBeaconProcessor()); frameGrabber.grabSingleFrame(); } @Override public boolean isDone() { return frameGrabber.isResultReady(); } @Override public StateName getNextStateName() { BeaconColorResult beaconColorResult = (BeaconColorResult) frameGrabber.getResult().getResult(); BeaconColorResult.BeaconColor leftColor = beaconColorResult.getLeftColor(); BeaconColorResult.BeaconColor rightColor = beaconColorResult.getRightColor(); if (leftColor == BeaconColorResult.BeaconColor.RED) { if (rightColor == BeaconColorResult.BeaconColor.RED) { return redRedState; } else if (rightColor == BeaconColorResult.BeaconColor.BLUE) { return redBlueState; } else { return redUnknownState; } } else if (leftColor == BeaconColorResult.BeaconColor.BLUE) { if (rightColor == BeaconColorResult.BeaconColor.RED) { return blueRedState; } else if (rightColor == BeaconColorResult.BeaconColor.BLUE) { return blueBlueState; } else { return blueUnknownState; } } else { if (rightColor == BeaconColorResult.BeaconColor.RED) { return unknownRedState; } else if (rightColor == BeaconColorResult.BeaconColor.BLUE) { return unknownBlueState; } else { return unknownUnknownState; } } } }; } /** * @param stateName the name of the state * @param nMotors the motors to turn off * @return the created State */ public static State stop(StateName stateName, final NMotors nMotors) { return new BasicAbstractState(stateName) { @Override public void init() { nMotors.stop(); } @Override public boolean isDone() { return false; } @Override public StateName getNextStateName() { return null; } }; } /** * @param stateName the name of the state * @param mecanumControl the motors to turn off * @return the created State */ public static State stop(StateName stateName, final MecanumControl mecanumControl) { return new BasicAbstractState(stateName) { @Override public void init() { mecanumControl.stop(); } @Override public boolean isDone() { return false; } @Override public StateName getNextStateName() { return null; } }; } /** * @param stateName the name of the state * @param message the message to display to the driver station * @param value the value associated with that message * @return the created State */ public static State telemetry(StateName stateName, final String message, final double value) { return new BasicAbstractState(stateName) { @Override public void init() { } @Override public boolean isDone() { telemetry.addData(message, value); return false; } @Override public StateName getNextStateName() { return null; } }; } /** * @param stateName the name of the state * @param message1 the first message to display to the driver station * @param input1 an InputExtractor that returns the value associated with the first message * @param message2 the second message to display to the driver station * @param input2 an InputExtractor that returns the value associated with the second message * @return the created State */ public static State telemetry(StateName stateName, final String message1, final InputExtractor<Double> input1, final String message2, final InputExtractor<Double> input2) { return new BasicAbstractState(stateName) { @Override public void init() { } @Override public boolean isDone() { telemetry.addData(message1, input1.getValue()); telemetry.addData(message2, input2.getValue()); return false; } @Override public StateName getNextStateName() { return null; } }; } /** * @param stateName the name of the state * @param transitions the list of transitions to the next states * @param message the message to display to the driver station * @param value the value associated with that message * @return the created State */ public static State telemetry(StateName stateName, List<Transition> transitions, final String message, final double value) { return new AbstractState(stateName, transitions) { @Override public void init() { } @Override public void run() { telemetry.addData(message, value); } @Override public void dispose() { } }; } /** * @param stateName the name of the state * @param transitions the list of transitions to the next states * @param message1 the first message to display to the driver station * @param input1 an InputExtractor that returns the value associated with the first message * @param message2 the second message to display to the driver station * @param input2 an InputExtractor that returns the value associated with the second message * @return the created State */ public static State telemetry(StateName stateName, List<Transition> transitions, final String message1, final InputExtractor<Double> input1, final String message2, final InputExtractor<Double> input2) { return new AbstractState(stateName, transitions) { @Override public void init() { } @Override public void run() { telemetry.addData(message1, input1.getValue()); telemetry.addData(message2, input2.getValue()); } @Override public void dispose() { } }; } /** * @param stateName the name of the state * @param nextStateName the name of the next state * @param servos the servos to be initialized * @return the created State * @see Servos */ public static State servoInit(StateName stateName, final StateName nextStateName, final Servos servos) { return new BasicAbstractState(stateName) { @Override public void init() { } @Override public boolean isDone() { return servos.areServosDone(); } @Override public StateName getNextStateName() { return nextStateName; } }; } /** * @param stateName the name of the state * @param nextStateName the name of the next state * @param gyro the gyro sensor to be calibrated * @return the created State * @see GyroSensor */ public static State calibrateGyro(StateName stateName, final StateName nextStateName, final GyroSensor gyro) { gyro.calibrate(); return new BasicAbstractState(stateName) { @Override public void init() { } @Override public boolean isDone() { return !gyro.isCalibrating(); } @Override public StateName getNextStateName() { return nextStateName; } }; } /** * @param stateName the name of the state * @param nextStateName the name of the next state * @param doubleLineSensor the 2 line sensors to be calibrated * @return the created State * @see DoubleLineSensor */ public static State calibrateLineSensor(StateName stateName, final StateName nextStateName, final DoubleLineSensor doubleLineSensor) { doubleLineSensor.calibrate(); return new BasicAbstractState(stateName) { @Override public void init() { } @Override public boolean isDone() { return doubleLineSensor.isReady(); } @Override public StateName getNextStateName() { return nextStateName; } }; } /** * Turn a servo to a preset at max speed * * @param stateName the name of the state * @param nextStateName the name of the state to go to next * @param servoControl the servo * @param servoPreset the preset to go to * @param waitForDone whether to wait for the servo to finish turning or move to the next state immediately * @return the created State * @see ServoControl */ public static State servoTurn(StateName stateName, StateName nextStateName, ServoControl servoControl, Enum servoPreset, boolean waitForDone) { return servoTurn(stateName, nextStateName, servoControl, servoPreset, ServoControl.MAX_SPEED, waitForDone); } /** * Turn a servo to a preset at a given speed * * @param stateName the name of the state * @param nextStateName the name of the state to go to next * @param servoControl the servo * @param servoPreset the preset to go to * @param speed the speed to turn the servo at * @param waitForDone whether to wait for the servo to finish turning or move to the next state immediately * @return the created State * @see ServoControl */ public static State servoTurn(StateName stateName, final StateName nextStateName, final ServoControl servoControl, final Enum servoPreset, final double speed, final boolean waitForDone) { return new BasicAbstractState(stateName) { @Override public void init() { servoControl.goToPreset(servoPreset, speed); } @Override public boolean isDone() { return !waitForDone || servoControl.isDone(); } @Override public StateName getNextStateName() { return nextStateName; } }; } /** * Turn a servo to a position at max speed * * @param stateName the name of the state * @param nextStateName the name of the state to go to next * @param servoControl the servo * @param servoPosition the position to go to * @param waitForDone whether to wait for the servo to finish turning or move to the next state immediately * @return the created State * @see ServoControl */ public static State servoTurn(StateName stateName, StateName nextStateName, ServoControl servoControl, double servoPosition, boolean waitForDone) { return servoTurn(stateName, nextStateName, servoControl, servoPosition, ServoControl.MAX_SPEED, waitForDone); } /** * Turn a servo to a position at a given speed * * @param stateName the name of the state * @param nextStateName the name of the state to go to next * @param servoControl the servo * @param servoPosition the position to go to * @param speed the speed to turn the servo at * @param waitForDone whether to wait for the servo to finish turning or move to the next state immediately * @return the created State * @see ServoControl */ public static State servoTurn(StateName stateName, final StateName nextStateName, final ServoControl servoControl, final double servoPosition, final double speed, final boolean waitForDone) { return new BasicAbstractState(stateName) { @Override public void init() { servoControl.setPosition(servoPosition, speed); } @Override public boolean isDone() { return !waitForDone || servoControl.isDone(); } @Override public StateName getNextStateName() { return nextStateName; } }; } /** * drive using the mecanum wheels * travels for a certain amount of time defined by the robots speed and a desired distance * * @param stateName the name of the state * @param nextStateName the next state to go to * @param distance the distance to travel * @param mecanumControl the mecanum wheels * @param gyro the gyro sensor * @param velocity the velocity to drive at * @param direction the direction to drive * @param orientation the angle to rotate to * @param maxAngularSpeed the max speed to rotate to that angle * @return the created State * @see MecanumControl * @see GyroSensor * @see Distance */ public static State mecanumDrive(StateName stateName, final StateName nextStateName, Distance distance, final MecanumControl mecanumControl, final GyroSensor gyro, final double velocity, final Angle direction, final Angle orientation, final Angle tolerance, final double maxAngularSpeed) { mecanumControl.setDriveMode(MecanumMotors.MecanumDriveMode.NORMALIZED); double speedMetersPerMillisecond = mecanumControl.getMaxRobotSpeed().metersPerMillisecond() * velocity; final double durationMillis = Math.abs(distance.meters() / speedMetersPerMillisecond); final EndCondition gyroEC = EVEndConditions.gyroCloseTo(gyro, orientation, tolerance); return new BasicAbstractState(stateName) { long startTime = 0; @Override public void init() { mecanumControl.setControl( TranslationControls.constant(velocity, direction), RotationControls.gyro(gyro, orientation, maxAngularSpeed) ); startTime = System.currentTimeMillis(); } @Override public boolean isDone() { long now = System.currentTimeMillis(); long elapsedTime = now - startTime; if (elapsedTime >= durationMillis) { mecanumControl.setTranslationControl(TranslationControls.ZERO); return gyroEC.isDone(); } return false; } @Override public StateName getNextStateName() { mecanumControl.stop(); return nextStateName; } }; } /** * drive using the mecanum wheels * * @param stateName the name of the state * @param transitions the list of transitions to the next states * @param mecanumControl the mecanum wheels * @param gyro the gyro sensor * @param velocity the velocity to drive at * @param direction the direction to drive * @param orientation the angle to rotate to * @param maxAngularSpeed the max speed to rotate to that angle * @return the created State * @see MecanumControl * @see GyroSensor */ public static State mecanumDrive(StateName stateName, List<Transition> transitions, final MecanumControl mecanumControl, final GyroSensor gyro, final double velocity, final Angle direction, final Angle orientation, final double maxAngularSpeed) { mecanumControl.setDriveMode(MecanumMotors.MecanumDriveMode.NORMALIZED); return new AbstractState(stateName, transitions) { @Override public void init() {
