// double gain = optionsFile.get("gyro_gain", Double.class); mecanumControl.setControl( TranslationControls.constant(velocity, direction), RotationControls.gyro(gyro, orientation, maxAngularSpeed)
// RotationControls.gyro(gyro, orientation, max, false, gain) ); } @Override public void run() { } @Override public void dispose() { mecanumControl.stop(); } }; } /** * @param stateName the name of the state * @param transitions the list of transitions to the next states * @param mecanumControl the mecanum wheels * @param gyro the gyro sensor * @param velocity the velocity to drive at * @param direction the direction to drive * @param orientation the angle to rotate to * @return the created State * @see MecanumControl * @see GyroSensor */ public static State mecanumDrive(StateName stateName, List<Transition> transitions, MecanumControl mecanumControl, GyroSensor gyro, double velocity, Angle direction, Angle orientation) { return mecanumDrive(stateName, transitions, mecanumControl, gyro, velocity, direction, orientation, RotationControl.DEFAULT_MAX_ANGULAR_SPEED); } /** * drive using the mecanum wheels * travels for a certain amount of time defined by the robots speed and a desired distance * * @param stateName the name of the state * @param nextStateName the next state to go to * @param distance the distance to travel * @param mecanumControl the mecanum wheels * @param gyro the gyro sensor * @param velocity the velocity to drive at * @param direction the direction to drive * @param orientation the angle to rotate to * @return the created State * @see MecanumControl * @see GyroSensor * @see Distance */ public static State mecanumDrive(StateName stateName, StateName nextStateName, Distance distance, final MecanumControl mecanumControl, final GyroSensor gyro, final double velocity, final Angle direction, final Angle orientation, final Angle tolerance) { return mecanumDrive(stateName, nextStateName, distance, mecanumControl, gyro, velocity, direction, orientation, tolerance, RotationControl.DEFAULT_MAX_ANGULAR_SPEED); } /** * follow a line with the mecanum wheels * * @param stateName the name of the state * @param transitions the list of transitions to the next states * @param lostLineState what state to go to if the line is lost * @param mecanumControl the mecanum wheels * @param doubleLineSensor the 2 line sensors * @param velocity the velocity to drive at * @param lineFollowDirection the direction (left or right) to follow the line at * @return the created State * @see MecanumControl * @see TranslationControls */ public State mecanumLineFollow(StateName stateName, List<Transition> transitions, StateName lostLineState, final MecanumControl mecanumControl, final DoubleLineSensor doubleLineSensor, final double velocity, final TranslationControls.LineFollowDirection lineFollowDirection) { transitions.add(new Transition(new EndCondition() { @Override public void init() { } @Override public boolean isDone() { return !mecanumControl.translationWorked(); } }, lostLineState)); mecanumControl.setDriveMode(MecanumMotors.MecanumDriveMode.NORMALIZED); return new AbstractState(stateName, transitions) { @Override public void init() { mecanumControl.setTranslationControl(TranslationControls.lineFollow(doubleLineSensor, lineFollowDirection, velocity)); } @Override public void run() { } @Override public void dispose() { mecanumControl.stop(); } }; } /** * Drive forward or backward with two motors * * @param stateName the name of the state * @param transitions the transitions to new states * @param twoMotors the motors to move * @param velocity the velocity to drive at (negative for backwards) * @return the created State * @see TwoMotors */ public static State drive(StateName stateName, List<Transition> transitions, final TwoMotors twoMotors, final double velocity) { return new AbstractState(stateName, transitions) { @Override public void init() { twoMotors.runMotors(velocity, velocity); } @Override public void run() { } @Override public void dispose() { twoMotors.runMotors(0, 0); } }; } /** * Turn left or right * * @param stateName the name of the state * @param transitions the transitions to new states * @param twoMotors the motors to move * @param velocity the velocity to turn at (negative for turning left) * @return the created State * @see TwoMotors */ public static State turn(StateName stateName, List<Transition> transitions, final TwoMotors twoMotors, final double velocity) { return new AbstractState(stateName, transitions) { @Override public void init() { twoMotors.runMotors(velocity, -velocity); } @Override public void run() { } @Override public void dispose() { twoMotors.runMotors(0, 0); } }; } /** * Turn with one wheel * * @param stateName the name of the state * @param transitions the transitions to new states * @param twoMotors the motors to move * @param isRightWheel tells which wheel to turn * @param velocity the velocity to turn the wheel at (negative for backwards) * @return the created State * @see TwoMotors */ public static State oneWheelTurn(StateName stateName, List<Transition> transitions, final TwoMotors twoMotors, final boolean isRightWheel, final double velocity) { return new AbstractState(stateName, transitions) { @Override public void init() { if (isRightWheel) { twoMotors.runMotors(0, velocity); } else { twoMotors.runMotors(velocity, 0); } } @Override public void run() { } @Override public void dispose() { twoMotors.runMotors(0, 0); } }; } /** * Drive for a certain distance * * @param stateName the name of the state * @param nextStateName the state to go to after the drive is done * @param distance the distance to drive * @param twoMotors the motors to move * @param velocity the velocity to drive at (negative for backwards) * @return the created State * @see TwoMotors */ public static State drive(StateName stateName, StateName nextStateName, Distance distance, TwoMotors twoMotors, double velocity) { double speedMetersPerMillisecond = twoMotors.getMaxRobotSpeed().metersPerMillisecond() * velocity; double durationMillis = Math.abs(distance.meters() / speedMetersPerMillisecond); return drive(stateName, ImmutableList.of( new Transition( EndConditions.timed((long) durationMillis), nextStateName ) ), twoMotors, velocity); } /** * Turn for a certain angle by calculating the time required for that angle * * @param stateName the name of the state * @param nextStateName the state to go to when done turning * @param angle the angle to turn * @param minRobotTurnTime the time it takes for the robot to turn * @param twoMotors the motors to run * @param velocity the velocity to turn (negative for turning left) * @return the created State * @see TwoMotors */ public static State turn(StateName stateName, StateName nextStateName, Angle angle, Time minRobotTurnTime, TwoMotors twoMotors, double velocity) { double speedRotationsPerMillisecond = velocity / minRobotTurnTime.milliseconds(); double durationMillis = Math.abs(angle.degrees() / 360 / speedRotationsPerMillisecond); return turn(stateName, ImmutableList.of( new Transition( EndConditions.timed((long) durationMillis), nextStateName ) ), twoMotors, velocity); } /** * Turn for a certain angle using a gyro sensor * * @param stateName the name of the state * @param nextStateName the state to go to when done turning * @param angle the angle to turn * @param gyro the gyro sensor to use * @param twoMotors the motors to turn * @param velocity the velocity to turn at (negative to turn left) * @return the created State * @see TwoMotors */ public static State turn(StateName stateName, StateName nextStateName, Angle angle, GyroSensor gyro, TwoMotors twoMotors, double velocity) { return turn(stateName, ImmutableList.of( new Transition( EVEndConditions.gyroCloseToRelative(gyro, angle, Angle.fromDegrees(5)), nextStateName ) ), twoMotors, velocity); } /** * Turn with one wheel for a certain angle by calculating the time needed to turn that angle * * @param stateName the name of the state * @param nextStateName the state to go to when done turning * @param angle the angle to turn * @param minRobotTurnTime the time it takes for the robot to turn * @param twoMotors the motors to turn * @param isRightWheel tells which wheel to turn * @param velocity the velocity to turn the wheel at (negative for backwards) * @return the created State * @see TwoMotors */ public static State oneWheelTurn(StateName stateName, StateName nextStateName, Angle angle, Time minRobotTurnTime, TwoMotors twoMotors, boolean isRightWheel, double velocity) { double speedRotationsPerMillisecond = velocity / minRobotTurnTime.milliseconds(); double durationMillis = Math.abs(2 * angle.degrees() / 360 / speedRotationsPerMillisecond); velocity = Math.abs(velocity) * Math.signum(angle.radians()); if (isRightWheel) { velocity *= -1; } return oneWheelTurn(stateName, ImmutableList.of( new Transition( EndConditions.timed((long) durationMillis), nextStateName ) ), twoMotors, isRightWheel, velocity); } /** * Turn with one wheel for a certain angle using a gyro sensor * * @param stateName the name of the state * @param nextStateName the state to go to after the turn is done * @param angle the angle to turn * @param gyro the gyro sensor to use * @param twoMotors the motors to turn * @param isRightWheel which wheel to use * @param velocity the velocity to turn the wheel at (negative for backwards) * @return the created State * @see TwoMotors */ public static State turn(StateName stateName, StateName nextStateName, Angle angle, GyroSensor gyro, TwoMotors twoMotors, boolean isRightWheel, double velocity) { velocity = Math.abs(velocity) * Math.signum(angle.radians()); if (isRightWheel) { velocity *= -1; } return oneWheelTurn(stateName, ImmutableList.of( new Transition( EVEndConditions.gyroCloseToRelative(gyro, angle, Angle.fromDegrees(5)), nextStateName ) ), twoMotors, isRightWheel, velocity); } /** * Turn a motor at a given power * * @param stateName the name of the state * @param transitions the transitions to new states * @param motor the motor to be turned * @param power the power to turn the motor at * @return the created State * @see TwoMotors */ public static State motorTurn(StateName stateName, List<Transition> transitions, final Motor motor, final double power) { return new AbstractState(stateName, transitions) { @Override public void init() { motor.setPower(power); } @Override public void run() { } @Override public void dispose() { motor.setPower(0); } }; } /** * Line up with the beacon using the line sensor array and distance sensor * * @param stateName the name of the state * @param successState the state to go to if the line up succeeds * @param failState the state to go to if the line up fails * @param mecanumControl the mecanum wheels * @param direction the direction angle to face * @param gyro the gyro to use for rotation stabilization * @param distSensor the distance sensor to detect distance from the beacon * @param lineSensorArray the line sensor array to line up sideways with the line * @param teamColor the team you are on and ... * @param beaconColorResult ... the beacon configuration to decide which button to line up with * @param distance the distance from the beacon to line up to * @return the created State * @see LineUpControl */ public static State beaconLineUp(StateName stateName, final StateName successState, final StateName failState, final MecanumControl mecanumControl, final Angle direction, final GyroSensor gyro, final DistanceSensor distSensor, final LineSensorArray lineSensorArray, TeamColor teamColor, final ResultReceiver<BeaconColorResult> beaconColorResult, final Distance distance) {
// final EndCondition distEndCondition = EVEndConditions.distanceSensorLess(distSensor, Distance.add(distance, Distance.fromInches(4))); final EndCondition distEndCondition = EVEndConditions.distanceSensorLess(distSensor, distance); final EndCondition gyroEndCondition = EVEndConditions.gyroCloseTo(gyro, direction, 2); final BeaconColorResult.BeaconColor myColor = BeaconColorResult.BeaconColor.fromTeamColor(teamColor); final BeaconColorResult.BeaconColor opponentColor = BeaconColorResult.BeaconColor.fromTeamColor(teamColor.opposite()); return new BasicAbstractState(stateName) { private boolean success; LineUpControl.Button buttonToLineUpWith; @Override public void init() { buttonToLineUpWith = null; if (beaconColorResult.isReady()) { BeaconColorResult result = beaconColorResult.getValue(); BeaconColorResult.BeaconColor leftColor = result.getLeftColor(); BeaconColorResult.BeaconColor rightColor = result.getRightColor(); if (leftColor == myColor && rightColor == opponentColor) { buttonToLineUpWith = LineUpControl.Button.LEFT; } if (leftColor == opponentColor && rightColor == myColor) { buttonToLineUpWith = LineUpControl.Button.RIGHT; } } success = buttonToLineUpWith != null; LineUpControl lineUpControl = new LineUpControl(lineSensorArray, buttonToLineUpWith, distSensor, distance, gyro, direction); mecanumControl.setTranslationControl(lineUpControl); mecanumControl.setRotationControl(lineUpControl); distEndCondition.init(); gyroEndCondition.init(); } @Override public boolean isDone() { if (!mecanumControl.translationWorked()) { success = false; } return !success || distEndCondition.isDone(); } @Override public StateName getNextStateName() { mecanumControl.stop(); return success ? successState : failState; } }; } public static State shoot(StateName stateName, final StateName nextStateName, final Shooter shooter, final int shots) { return new BasicAbstractState(stateName) { @Override public void init() { shooter.shoot(shots); } @Override public boolean isDone() {
// shooter.act(); return shooter.isDone(); } @Override public StateName getNextStateName() { return nextStateName; } }; } public static State gyroStabilize(StateName stateName, StateName nextStateName, final MecanumControl mecanumControl, final GyroSensor gyro, final Angle orientation, Angle tolerance) { List<Transition> transitions = ImmutableList.of( new Transition(EVEndConditions.gyroCloseTo(gyro, orientation, tolerance), nextStateName) ); return new AbstractState(stateName, transitions) { @Override public void init() { mecanumControl.setTranslationControl(TranslationControls.ZERO); mecanumControl.setRotationControl(RotationControls.gyro(gyro, orientation)); } @Override public void run() { } @Override public void dispose() { mecanumControl.stop(); } }; } public static State switchPressed(StateName stateName, StateName pressedStateName, StateName timeoutStateName, DigitalSensor digitalSensor, Time timeout) { return empty(stateName, ImmutableList.of( new Transition(EndConditions.inputExtractor(digitalSensor), pressedStateName), new Transition(EndConditions.timed((long) timeout.milliseconds()), timeoutStateName) )); } public static State initShooter(StateName stateName, final StateName nextStateName, final Shooter shooter) { return new BasicAbstractState(stateName) { @Override public void init() { shooter.initialize(); } @Override public boolean isDone() { return shooter.isDone(); } @Override public StateName getNextStateName() { return nextStateName; } }; } public static State beaconColorSwitch(StateName stateName, final StateName leftButtonState, final StateName rightButtonState, final StateName unknownState, TeamColor teamColor, final ResultReceiver<BeaconColorResult> beaconColorResult) { final BeaconColorResult.BeaconColor myColor = BeaconColorResult.BeaconColor.fromTeamColor(teamColor); final BeaconColorResult.BeaconColor opponentColor = BeaconColorResult.BeaconColor.fromTeamColor(teamColor.opposite()); return new BasicAbstractState(stateName) { private StateName nextState = unknownState; @Override public void init() { if (beaconColorResult.isReady()) { BeaconColorResult result = beaconColorResult.getValue(); BeaconColorResult.BeaconColor leftColor = result.getLeftColor(); BeaconColorResult.BeaconColor rightColor = result.getRightColor(); if (leftColor == myColor && rightColor == opponentColor) { nextState = leftButtonState; } if (leftColor == opponentColor && rightColor == myColor) { nextState = rightButtonState; } } } @Override public boolean isDone() { return true; } @Override public StateName getNextStateName() { return nextState; } }; } }

