To use the servos in TeleOp, you have to first get the servo from the robotCfg: armServo = robotCfg.getServo(SampleRobotCfg.SampleServoName.ARM_SERVO); Then you can move the servo to a preset with: armServo.goToPreset(SampleRobotCfg.ArmServoPresets.RIGHT); You can also specify the speed if you want the servo to turn more slowly: armServo.goToPreset(SampleRobotCfg.ArmServoPresets.RIGHT, 0.2); The following is the new TeleOp program with the servos added. This example uses guava to initialize lists, which we have left for alternative methods. /sample/v3/SampleTeleOp.java package org.firstinspires.ftc.teamcode.sample.v3; import com.google.common.collect.ImmutableList;
