Adding servos to the autonomous is a bit more tricky than adding them to TeleOp. First we have to add convenience methods in the SampleStateMachineBuilder /sample/v3/SampleStateMachineBuilder.java package org.firstinspires.ftc.teamcode.sample.v3; import ftc.electronvolts.statemachine.StateMachineBuilder;
