Vuforia and OpenCV are image processing libraries. Vuforia is by PTC and is built in to the latest version of the FTC app. It has high-level functions for tracking objects and augmented reality. It is very useful for finding the position of the beacon target images. OpenCV is an open source library that is more low-level, and because of this it is possible to write the procedures yourself and optimize them for better performance. Before you can use this example, you have to: Set up OpenCV. A guide is available on our website at http://www.gearbox4h.org/opencv/ (no longer exists) Create a Vuforia developer account and get a license key from https://developer.vuforia.com/license-manager This example uses EVLib functionality to: Initialize Vuforia Find the "Gears" beacon target image (this is controlled by the TeamColor.RED input) Crop the beacon out of the frame based on the target image location Find the beacon's color This example uses guava to initialize lists, which we have left for alternative methods. sample/v3/SampleVuforiaOp.java package org.firstinspires.ftc.teamcode.sample.v3; import com.google.common.collect.ImmutableList;
