@Autonomous(name = "SampleVuforiaOp V3")
public class SampleVuforiaOp extends AbstractAutoOp<RobotCfg> { //get a key (for free) and paste it below by creating an account at https://developer.vuforia.com/license-manager private static final String LICENSE_KEY = ""; private static final int FRAME_SIZE = 16;
// private static final int FRAME_SIZE = 8;
